func minOperations(nums []int, target int) int {
    sum := 0
    maxPower := 0
    for _, num := range nums {
        sum += num
        for x := num; x > 0; x /= 2 {
            maxPower = max(maxPower, x)
        }
    }
    if sum < target {
        return -1
    }

    operations, currentSum := 0, 0
    count := make(map[int]int)
    for _, num := range nums {
        count[num]++
    }

    for power := maxPower; power > 0 && currentSum != target; power /= 2 {
        if currentSum+power <= target {
            if count[power] > 0 {
                currentSum += power
                count[power]--
            } else if power > 1 {
                count[power] += 2
                count[power/2] -= 2
                operations++
            }
        }
    }

    if currentSum == target {
        return operations
    }
    return -1
}

func max(a, b int) int {
    if a > b {
        return a
    }
    return b
}
